function jsonStringify(value, replacer, space) {
    try {
        return JSON.stringify(value, replacer, space);
    }
    catch {
        return '';
    }
}
function trackFirstSeen(map, keys) {
    let ret = true;
    if (keys.length > 1) {
        let sub = map.get(keys[0]);
        if (sub) {
            if (sub.has(keys[1])) {
                ret = false;
            }
            else {
                sub.set(keys[1], true);
            }
        }
        else {
            sub = new Map();
            sub.set(keys[1], true);
            map.set(keys[0], sub);
        }
    }
    else if (map.has(keys[0])) {
        ret = false;
    }
    else {
        map.set(keys[0], true);
    }
    return ret;
}

